import React, { Component } from "react";
import "./App.css";

class App extends React.Component {
  render(){
    return (
      <div>
        <Router>
          <Route exact path='/' Component={searchBox}/>
          <Route exact path='/map' Component={App_Btn}/>
        </Router>
      </div>
    )
  }
}

class app_logo extends React.Component{
  return(){
  <div>
    <h1>카 고</h1>
    <h6>주변 카페 자리를 확인해보세요~</h6>
  </div>
  }
}

class searchBox extends React.Component{
  return(){
  <div>
    <input id='search' type="search"></input>
    <input  id='searchBtn' type="submit" value='검색'></input>
  </div>
  }
}

class App_btn extends React.Component{
  return(){
  <a
className="App-link"
href="https://reactjs.org"
target="_blank"
rel="noopener noreferrer"
>
  현재 위치로 확인
  </a>
  }
}
export default App;
